import { useState } from "react";


export function Books(){
    const [book1, setBook1] = useState(13)
    const [pen, setPen] = useState(10)
    const [book2, setBook2] = useState(44)
    const [ink, setInk] = useState(78)
    const handler1 = (value)=>{
        setBook1(book1+value)
    }
    const handler2 = (value)=>{
        setInk(ink+value)
    }
    const handler3 = (value)=>{
        setPen(pen+value)
    }

    const handler4 = (value)=>{
        setBook2(book2+value)
    }

    return <div> className="main" 
        <div className="items">
    <span>Books:</span>
    <button className="addBook" onClick={()=>{handler1(1)}}>
        +
    </button>
    <button className="remBook" onClick={()=>{
       if(book===13){
           return
       }
       else{
        {handler1(-1)}
       }
     } }>
        -
    </button>
    <span className="totalBooks">{book1}</span>
</div>,
<div className="items">
    <span>Pen:</span>
    <button className="addPen" onClick={()=>{handler2(1)}}>
        +
    </button>
    <button className="remPen" onClick={()=>{
       if(pen===10){
           return
       }
       else{
        {handler2(-1)}
       }
     } }>
        -
    </button>
    <span className="totalPens">{pen}</span>
</div>,
<div className="items">
    <span>Notebook:</span>
    <button className="addNotebook" onClick={()=>{handler4(1)}}>
        +
    </button>
    <button className="remNotebook" onClick={()=>{
       if(book===44){
           return
       }
       else{
        {handler4(-1)}
       }
     } }>
        -
    </button>
    <span className="totalNotebooks">{book2}</span>
</div>,
<div className="items">
    <span>Books:</span>
    <button className="addInkpen" onClick={()=>{handler3(1)}}>
        +
    </button>
    <button className="remInkpen" onClick={()=>{
       if(ink===78){
           return
       }
       else{
        {handler3(-1)}
       }
     } }>
        -
    </button>
    <span className="totalInkpens">{ink}</span>
</div>
</div>
}
